import React from 'react'


const TodoItem = ({TODO}) => {
    return (
        <tr>
            <td>
                {TODO.text}
            </td>
            <td>
                {TODO.project}
            </td>
            <td>
                {TODO.users}
            </td>
            <td>
                {TODO.update_date}
            </td>
            <td>
                {TODO.is_active}
            </td>
        </tr>
    )
}

const TodoList = ({TODO}) => {
    return (
        <table>
            <th>
                TODO text
            </th>
            <th>
                TODO project
            </th>
            <th>
                TODO users
            </th>
            <th>
                TODO update_date
            </th>
            <th>
                TODO is_active
            </th>
            {TODO.map((TODO) => <TodoItem TODO={TODO} />)}
        </table>
    )
}

export default TodoList
